    }

    .info__view {
      display: -webkit-box;
      display: -ms-flexbox;
      display: flex;
      -webkit-box-align: center;
      -ms-flex-align: center;
      align-items: center
    }

    .info__comments,
    .info__view {
      margin-right: 2rem
    }

    .info__comments svg,
    .info__view svg {
      margin-right: 1rem
    }

    .info__dots {
      margin-left: 1rem
    }

    @-webkit-keyframes sbMsgArrow {
      0% {
        -webkit-transform: translate(0);
        transform: translate(0)
      }

      50% {
        -webkit-transform: translate(5px, -5px);
        transform: translate(5px, -5px)
      }

      to {
        -webkit-transform: translate(0);
        transform: translate(0)
      }
    }

    @keyframes sbMsgArrow {
      0% {
        -webkit-transform: translate(0);
        transform: translate(0)
      }

      50% {
        -webkit-transform: translate(5px, -5px);
        transform: translate(5px, -5px)
      }

      to {
        -webkit-transform: translate(0);
        transform: translate(0)
      }
    }

    .mobile .wrapper,
    .tablet .wrapper {
      -webkit-box-pack: start;
      -ms-flex-pack: start;
      justify-content: flex-start
    }

    .mobile .success-text,
    .tablet .success-text {
      margin-top: auto;
      padding: 4rem 2rem;
      position: static;
      -webkit-transform: none;
      transform: none
    }

    .mobile .success-arrow,
    .tablet .success-arrow {
      bottom: 15rem;
      left: 50%;
      margin-left: 10px;
      top: auto
    }

    .mobile .player__play,
    .tablet .player__play {
      margin-top: 0
    }

    .mobile .player,
    .tablet .player {
      height: calc(100vh - 35rem)
    }

    @media screen and (max-width:620px) {

      .mobile .player,
      .tablet .player {
        max-height: 250px
      }
    }
  </style>
</head>
